  //console.log(usersPayload);
  //call function to send to server
  sendUsersToServer();
}

function sendUsersToServer(){
  $.ajax({
    url:'insertUser.php',
    type:'post',
    dataType:'text',
    data:{users:usersPayload},
    success:function(data){
      console.log(data);
      //check if we still need to process more records
      if(stepper<3805){
        //modify stepper to start at correct position for next batch
        stepper+=250;
        end=stepper+250;
        //call function to prepare next batch
        preparePayload();
      }else{

        console.log('finished processing');
        clearInterval(int);
        $('.messageDiv').html('Finished processing');
        $('button').remove();
      }
    },
    error:function(x,m,s){console.log(s)}
  });
}



var int;//for setInterval timer feedabck
function startProcessing(){

  //for feedback
  $('.messageDiv').html('<span class="message"></span> milliseconds');
  int = setInterval(function(){
    var curr = Number($('.message').html());
    curr++;
    $('.message').html(curr);
  },1);

  //start the process
  preparePayload();

}



</script>
